import React from 'react';
import { 
  Container, 
  Typography, 
  Box, 
  Button, 
  Grid, 
  Card, 
  CardContent,
  useTheme,
  IconButton 
} from '@mui/material';
import { useNavigate } from 'react-router-dom';
import AccessTimeIcon from '@mui/icons-material/AccessTime';
import AutoGraphIcon from '@mui/icons-material/AutoGraph';
import CalendarMonthIcon from '@mui/icons-material/CalendarMonth';
import KeyboardArrowDownIcon from '@mui/icons-material/KeyboardArrowDown';

function Home() {
  const theme = useTheme();
  const navigate = useNavigate();

  const scrollToFeatures = () => {
    const featuresSection = document.getElementById('features');
    featuresSection.scrollIntoView({ behavior: 'smooth' });
  };

  return (
    <Box sx={{ minHeight: '100vh', bgcolor: '#121212', color: 'white' }}>
      {/* Hero Section */}
      <Box
        sx={{
          position: 'relative',
          minHeight: '100vh',
          display: 'flex',
          alignItems: 'center',
          justifyContent: 'center',
          textAlign: 'center',
          background: 'linear-gradient(to bottom, #0d0d0d, #1a1a1a)',
          padding: '2rem',
        }}
      >
        <Container maxWidth="lg">
          <Typography
            variant="h1"
            sx={{
              fontSize: { xs: '3rem', md: '5rem' },
              fontWeight: 800,
              textTransform: 'uppercase',
              letterSpacing: '0.05em',
              background: 'linear-gradient(to right, #ff416c, #ff4b2b)',
              WebkitBackgroundClip: 'text',
              WebkitTextFillColor: 'transparent',
              mb: 2,
            }}
          >
            Master Your Time
          </Typography>
          <Typography
            variant="h4"
            sx={{
              fontSize: { xs: '1.5rem', md: '2rem' },
              color: '#bdbdbd',
              fontWeight: 400,
              mb: 4,
            }}
          >
            AI-Powered Study Schedule Optimization
          </Typography>
          <Box sx={{ display: 'flex', gap: 2, justifyContent: 'center' }}>
            <Button variant="contained" size="large" sx={{ px: 5, py: 2, fontSize: '1.2rem', borderRadius: '30px' }} onClick={() => navigate('/register')}>
              Get Started
            </Button>
            <Button variant="outlined" size="large" sx={{ px: 5, py: 2, fontSize: '1.2rem', borderRadius: '30px', borderColor: '#ff416c', color: '#ff416c' }} onClick={() => navigate('/login')}>
              Login
            </Button>
          </Box>
        </Container>
        {/* Scroll Indicator */}
        <Box sx={{ position: 'absolute', bottom: 40, textAlign: 'center' }} onClick={scrollToFeatures}>
          <Typography variant="body2" sx={{ color: '#bdbdbd', mb: 1 }}>
            Scroll Down
          </Typography>
          <IconButton sx={{ color: '#ff416c' }}>
            <KeyboardArrowDownIcon fontSize="large" />
          </IconButton>
        </Box>
      </Box>

      {/* Features Section */}
      <Box id="features" sx={{ py: 10, bgcolor: '#1a1a1a' }}>
        <Container maxWidth="lg">
          <Typography variant="h3" align="center" sx={{ mb: 6, fontSize: '2.5rem', fontWeight: 700, color: 'white' }}>
            Why Choose Tempo?
          </Typography>
          <Grid container spacing={4}>
            {[
              { icon: <AccessTimeIcon />, title: "Smart Scheduling", desc: "AI-powered scheduling that adapts to your study habits." },
              { icon: <AutoGraphIcon />, title: "Performance Analytics", desc: "Track progress with real-time insights." },
              { icon: <CalendarMonthIcon />, title: "Seamless Planning", desc: "Manage your academic schedule effortlessly." }
            ].map((feature, index) => (
              <Grid item xs={12} md={4} key={index}>
                <Card sx={{ bgcolor: '#222', color: 'white', borderRadius: '15px', textAlign: 'center', p: 4, boxShadow: '0px 0px 15px rgba(255, 65, 108, 0.2)' }}>
                  <Box sx={{ fontSize: 40, color: '#ff416c', mb: 2 }}>{feature.icon}</Box>
                  <Typography variant="h5" sx={{ fontWeight: 700, mb: 1 }}>{feature.title}</Typography>
                  <Typography variant="body1" sx={{ color: '#bdbdbd' }}>{feature.desc}</Typography>
                </Card>
              </Grid>
            ))}
          </Grid>
        </Container>
      </Box>

      {/* CTA Section */}
      <Box sx={{ py: 10, textAlign: 'center', bgcolor: '#121212' }}>
        <Container maxWidth="md">
          <Typography variant="h3" sx={{ mb: 3, fontSize: '2.5rem', fontWeight: 700, color: 'white' }}>
            Ready to Transform Your Study Routine?
          </Typography>
          <Typography variant="h6" sx={{ mb: 4, color: '#bdbdbd', fontSize: '1.2rem' }}>
            Join thousands of students optimizing their study habits with Tempo.
          </Typography>
          <Button variant="contained" size="large" sx={{ px: 6, py: 2, fontSize: '1.2rem', borderRadius: '30px' }} onClick={() => navigate('/register')}>
            Get Started Now
          </Button>
        </Container>
      </Box>
    </Box>
  );
}

export default Home;
